import "../../../../scss/utils/_all.scss";
import "../../../../scss/app/_controlPanel.scss";
import { NavLink as Link } from "react-router-dom";
import '../../../../scss/utils/_all.scss';

import React, { Component } from 'react'

export default class ControlPanel extends Component {
    render() {

        const active = {
            color: `${tableText-functionIcons}`,
            fontWeight: '400',
            paddingTop: '30px',
            margin: '0 30px 30px 30px',
            span: {
                color: $buttons-screenHeaders-distinctions,
            }
        }

        return (
            <div className=' col-lg-12'>
                    <div className="sidePanelWrap col-lg-2">
                        <ul>
                            <div  className='sidePanelElem'>
                            <Link to='/' activeStyle={active}><li >Pulpit </li></Link>

                            <span> > </span>
                            </div>

                            <li className='sidePanelElem'>Przepisy</li>
                            <li className='sidePanelElem'>Plany</li>
                        </ul>
                    </div>
                    <div className='componentPanel'>

                    </div>
            </div>
        )
    }
}
